import styled from 'styled-components';

export const TopImageContainer = styled.div`
  position: relative;
  width: 100%;
  height: 200px;
  background-size: cover;
  background-repeat: no-repeat;
  background-position: center;
`;

export const AstronautContainer = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  margin: 20px;
  z-index: 1;
`;
